new FakeClock.TaskFilter(){
  @Override public boolean shouldAccept(  Runnable runnable){
    return runnable == selectedRunnable;
  }
}

new Runnable(){
  @Override public void run(){
synchronized (lock) {
      if (shutdown) {
        return;
      }
      ClientTransport newActiveTransport=transportFactory.newClientTransport(server,authority);
      log.log(Level.INFO,"Created transport {0} for {1}",new Object[]{newActiveTransport,server});
      transports.add(newActiveTransport);
      newActiveTransport.start(new TransportListener(newActiveTransport,activeTransportFuture));
      Preconditions.checkState(activeTransportFuture.set(newActiveTransport),"failed to set the new transport to the future");
    }
  }
}

