new Answer<ChannelFuture>(){
  @Override public ChannelFuture answer(  InvocationOnMock in) throws Throwable {
    ChannelPromise promise=(ChannelPromise)in.getArguments()[1];
    promise.trySuccess();
    return promise;
  }
}
